import React, { useState } from "react";
import "./Navbar.css";
import defaultProfile from "../../assets/default-profile.png"; // Use a placeholder profile picture

const Navbar = ({ handleLogout, user }) => {
  const [isProfileOpen, setIsProfileOpen] = useState(false);

  const toggleProfileMenu = () => {
    setIsProfileOpen(!isProfileOpen);
  };

  return (
    <nav className="navbar">
      <div className="navbar-brand">Text2Query</div>
      <div className="profile-container">
        <img
          src={user?.profilePhoto || defaultProfile}
          alt="Profile"
          className="profile-photo"
          onClick={toggleProfileMenu}
        />
        {isProfileOpen && (
          <div className="profile-menu">
            <p><strong>{user?.name || "User"}</strong></p>
            <p>{user?.designation || "Designation"}</p>
            <button className="logout-button" onClick={handleLogout}>
              Sign Out
            </button>
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
